import React, { useState } from 'react';
import { connect, useDispatch, useSelector } from "react-redux";

import ButtonBlock from './ButtonBlock';

function LevelBlock_1(props) {


    const classnameLetters = {
        'buttonLetter': 'buttonLetter',
        'letter1': 'letter1',
        'letter2': 'letter2',
        'letter3': 'letter3'
    }

    const coin = useSelector(state => state.stateLevelCoins.letterBlocks[0]);
    const stateLetters = useSelector(state => state.stateLettersBlocks[0]);

    const [levelСompleted, setLevelCompleted] = useState([false, false, false, false, false, false])

    const hendlerButtonBlock = (data, numberBlock) => {
        console.log('back ', data) 
        if (data === true) {
            let flagArr = [...levelСompleted];
            flagArr[numberBlock] = true;
            setLevelCompleted(flagArr);
            
            if (flagArr.every(x => x === true) === true) {
                console.log('level completed ', true);

            }
        }
    }

    return (

            <div>
                <ButtonBlock
                    namesLettersButtons={stateLetters[0]}
                    classnameLetters={classnameLetters}
                    hendlerButtonBlock={hendlerButtonBlock}
                    numberBlock={0}
                    coin={coin}
                />
                <ButtonBlock
                    namesLettersButtons={stateLetters[1]}
                    classnameLetters={classnameLetters}
                    hendlerButtonBlock={hendlerButtonBlock}
                    numberBlock={1}
                    coin={coin}
                />
                <ButtonBlock
                    namesLettersButtons={stateLetters[2]}
                    classnameLetters={classnameLetters}
                    hendlerButtonBlock={hendlerButtonBlock}
                    numberBlock={2}
                    coin={coin}
                />
                <ButtonBlock
                    namesLettersButtons={stateLetters[3]}
                    classnameLetters={classnameLetters}
                    hendlerButtonBlock={hendlerButtonBlock}
                    numberBlock={3}
                    coin={coin}
                />
                <ButtonBlock
                    namesLettersButtons={stateLetters[4]}
                    classnameLetters={classnameLetters}
                    hendlerButtonBlock={hendlerButtonBlock}
                    numberBlock={4}
                    coin={coin}
                />
                <ButtonBlock
                    namesLettersButtons={stateLetters[5]}
                    classnameLetters={classnameLetters}
                    hendlerButtonBlock={hendlerButtonBlock}
                    numberBlock={5}
                    coin={coin}
                />

            </div>
        
     )
}

export default connect()(LevelBlock_1)
